css:
@namespace url(http://www.w3.org/1999/xhtml);
@-moz-document url-prefix(about:neterror) {
html{background-color: #fff;}
#errorTitle{color: #F63;}
#errorTitleText
{
  font-size: 220%;
  border-bottom: none;
  background: none;
}
#errorPageContainer > div{margin-left: 200px;}
#errorPageContainer button
{
  width: auto;
  height: 27px;
  padding: 0px 8px 0px 8px;
  border: none;
  margin-left: 206px;
  background-color: #DDE0E5;
  box-shadow: none;
  text-shadow: none;
  border-radius: 0;
  cursor: pointer;
}
#errorPageContainer button::-moz-focus-inner{border: 0;}
#errorPageContainer button:hover{background-color: #E3E4E5;}
#errorPageContainer{
  border: none;
  background: url('data:image/png;base64,') no-repeat scroll left 0px content-box;
}
}
